import Layout from "../layout";
import Innerlayout from "../layout/Innerlayout";
import Inputbox from "../common/Inputbox";
import Button from "../common/Button";
import ButtonSignup from "../common/ButtonSignup";

const Login = () => {
  return (
    <Layout>
      <Innerlayout heading={"Sign up"}>
        <Inputbox  type="email" placeholder="Enter your " required heading="Email" />
        <Inputbox type="text" placeholder="Name" />
        <Inputbox type="password" placeholder="Password*" required />
        <Inputbox type="password" placeholder="Confirm Passsword*" required />
        <div className="Signup-buttons">
          <button className="signup-cancel">CANCEL</button>
          <button className="signup-button">SIGN UP</button>
        </div>
      </Innerlayout>
    </Layout>
  );
};

export default Login;
